import React from 'react';
import PropTypes from 'prop-types';

class Pokemon extends React.Component {
  render() {
    let info = this.props;
    console.log(info);
    return (
      <h1>{info.map((pokemon)=> pokemon.name)}</h1>
    )
  }
}

export default Pokemon;
